import React from "react";
import { Card } from "react-bootstrap";

const MoneyCard = ({ amount, title, saved }) => {
  return (
    <div>
      <Card className="rounded-5 my-2">
        <Card.Body className="mx-2">
          <Card.Text>{title}</Card.Text>
          {saved ? (
            <div>
              <span>${saved}</span>
              <span> / $ {amount}</span>
            </div>
          ) : (
            <h4>${amount}</h4>
          )}
        </Card.Body>
      </Card>
    </div>
  );
};

export default MoneyCard;
